--CREATURE_DIFFICULTYFLAGS_NO_LOOT                           
/*SELECT clt.*, ct.entry, ct.lootid, ct.name, HEX(dbc.Flags1) AS Flags1, HEX(dbc.Flags2) AS Flags2, HEX(dbc.Flags3) AS Flags3, HEX(dbc.Flags4) AS Flags4, ct.*
FROM dbc.dbc_creaturedifficulty dbc 
JOIN world.creature_template ct ON ct.entry = dbc.CreatureId
JOIN world.creature_loot_template clt ON clt.Entry = ct.lootid
WHERE  Flags1 & 0x00000004
AND ct.lootid IS NOT NULL
-- AND (Flags1 & 0x00010000)
AND ct.entry NOT IN (12435)	
AND ct.lootid IN (SELECT lootid  FROM creature_template GROUP BY lootid HAVING COUNT(*) < 3)
AND clt.Entry NOT IN (SELECT Entry FROM creature_loot_template WHERE QuestRequired = 1)
