-- CREATURE_DIFFICULTYFLAGS_2_DEAD_INTERACT                   
/*
SELECT ct.entry, ct.name, HEX(dbc.Flags1) AS Flags1, HEX(dbc.Flags2) AS Flags2, HEX(dbc.Flags3) AS Flags3, HEX(dbc.Flags4) AS Flags4, ct.*
FROM dbc.dbc_creaturedifficulty dbc 
JOIN world.creature_template ct ON ct.entry = dbc.CreatureId
WHERE  Flags2 & 0x00000800
AND NOT (ct.type_flags & 0x0080 )
GROUP BY ct.entry
*/
UPDATE creature_template SET type_flags = type_flags | 0x0080 WHERE entry IN (3891, 3916, 4054, 50084);



